import React, { useState } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';

const F1Predictor = () => {
  const [predictions, setPredictions] = useState(null);
  const [formData, setFormData] = useState({
    gridPosition: 1,
    q1Time: 80.0,
    q2Time: 0.0,
    q3Time: 0.0,
    teamPoints: 0,
    teamAvgPoints: 0.0,
    driverPoints: 0,
    recentAvgPosition: 10.0,
    constructor: 0,
    track: 0,
    laps: 50,
    raceRound: 1
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:5000/api/predict', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });
      const data = await response.json();
      setPredictions(data);
    } catch (error) {
      console.error('Error:', error);
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  return (
    <div className="max-w-6xl mx-auto p-4">
      <h1 className="text-3xl font-bold mb-6">F1 Race Predictor</h1>

      <form onSubmit={handleSubmit} className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 mb-8">
        {/* Qualifying Section */}
        <div className="p-4 border rounded-lg">
          <h2 className="text-xl font-semibold mb-4">Qualifying</h2>
          <div className="space-y-4">
            <div>
              <label className="block mb-1">Grid Position</label>
              <input
                type="number"
                name="gridPosition"
                value={formData.gridPosition}
                onChange={handleInputChange}
                className="w-full p-2 border rounded"
              />
            </div>
            <div>
              <label className="block mb-1">Q1 Time</label>
              <input
                type="number"
                name="q1Time"
                value={formData.q1Time}
                onChange={handleInputChange}
                className="w-full p-2 border rounded"
                step="0.001"
              />
            </div>
            {/* Add Q2 and Q3 similarly */}
          </div>
        </div>

        {/* Team Performance */}
        <div className="p-4 border rounded-lg">
          <h2 className="text-xl font-semibold mb-4">Team Performance</h2>
          <div className="space-y-4">
            <div>
              <label className="block mb-1">Team Points</label>
              <input
                type="number"
                name="teamPoints"
                value={formData.teamPoints}
                onChange={handleInputChange}
                className="w-full p-2 border rounded"
              />
            </div>
            <div>
              <label className="block mb-1">Constructor</label>
              <select
                name="constructor"
                value={formData.constructor}
                onChange={handleInputChange}
                className="w-full p-2 border rounded"
              >
                {["Mercedes", "Red Bull", "Ferrari", "McLaren", "Alpine",
                  "AlphaTauri", "Aston Martin", "Williams", "Alfa Romeo", "Haas"].map((team, index) => (
                  <option key={team} value={index}>{team}</option>
                ))}
              </select>
            </div>
          </div>
        </div>

        {/* Race Information */}
        <div className="p-4 border rounded-lg">
          <h2 className="text-xl font-semibold mb-4">Race Information</h2>
          <div className="space-y-4">
            <div>
              <label className="block mb-1">Track</label>
              <select
                name="track"
                value={formData.track}
                onChange={handleInputChange}
                className="w-full p-2 border rounded"
              >
                {["Bahrain", "Saudi Arabia", "Australia", /* Add all tracks */].map((track, index) => (
                  <option key={track} value={index}>{track}</option>
                ))}
              </select>
            </div>
            <div>
              <label className="block mb-1">Race Round</label>
              <input
                type="number"
                name="raceRound"
                value={formData.raceRound}
                onChange={handleInputChange}
                className="w-full p-2 border rounded"
              />
            </div>
          </div>
        </div>

        <div className="col-span-full">
          <button
            type="submit"
            className="w-full bg-blue-600 text-white py-3 rounded-lg hover:bg-blue-700"
          >
            Make Prediction
          </button>
        </div>
      </form>

      {predictions && (
        <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
          {Object.entries(predictions).map(([key, value]) => (
            <div key={key} className="p-4 border rounded-lg text-center">
              <h3 className="font-semibold">{key}</h3>
              <p className="text-2xl">{(value * 100).toFixed(1)}%</p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default F1Predictor;
